import React from 'react';
import './input.css';

const Input = ({ text, style, className, ...props }) => {
  return (
    <input
      type="text"
      value={text}
      className={`Input ${className}`}
      style={style}
      readOnly
      {...props}
    />
  );
};

export default Input;
